import React, {Component} from 'react'
import { Link } from 'react-router-dom'
import { Menu } from 'antd';

import './header.less'
/*
头部组件
 */
const { SubMenu } = Menu
export default class Header extends Component{
    render(){
        return(
            <Menu mode="horizontal" defaultSelectedKeys={['favorites']}>
                <Menu.Item key="index"><Link to={'/'}>首页</Link></Menu.Item>
                <SubMenu key="tools" title="小工具">
                    <Menu.Item key="favorites"><Link to={'/tools/favorites'}>收藏夹</Link></Menu.Item>
                    <Menu.Item key="others"><Link to={'/tools/others'}>便签</Link></Menu.Item>
                </SubMenu>
            </Menu>
        )
    }
}
